  render(){
    return(
      <ol>
          <Image linkgambar=""/>
          <li>Nasi Padang</li>
          <Image linkgambar="" />
          <li>Sate</li>
          <Image linkgambar=""/>
          <li>Soto Lamongan</li>
          <Image linkgambar=""/>
      </ol>
    );
  }
}

export default List;
